import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Switch,
  Route,
  Link,

} from "react-router-dom";
import Settings from './Settings'

function App() {
  return(

    <Router>
      <Link to="/">App</Link>
      <Link to="/settings">Settings</Link>
      <Routes>
        <Route path="/" element={<Settings />} />
        <Route path="/settings" element={<Settings />} />
      </Routes>
    </Router>
  );
}

export default App;
